import React from 'react';
import image from "../Images/logoWithoutBG.png";

const Header = () => {
    return (
        <>
            <div className={'d-flex header'}>
                <div className={'logo'}>
                    <img src={image}/>
                </div>

            </div>
        </>
    );
};

export default Header;
